import { AppBar, Toolbar } from "@mui/material";
import React from "react";

const StyledToolbar = styled(Toolbar)({
    display:"felex"
})

const Navbar = () => {
        return (
            <AppBar position="stick">
                <Toolbar>Navbar</Toolbar>
            </AppBar>
        );
};

export default Navbar;
